import React from "react";
import Template from "./Template";
import TemplateBox from "./TemplateBox";


function Skills() {
    return (
        <div className="Skills">
            <Template
                h1="Skills"
                h2="Frontend Developer"
                description={
                    "Blanks"
                }
            />
        </div>
    )
}

export default Skills;
